import React from 'react'
import './Language.css'

const Language = () => {
  return (
    <div className='login-page-language'>
      <i className="fa-solid fa-earth-americas"></i>
      <span className='text'>Language</span>
      <i className="fa-solid fa-caret-down"></i>
    </div>
  )
}

export default Language;
